pode estar utilizando outros módulos que registram suas próprias rotinas de tratamento para os mesmos 
tipos de evento nos mesmos elementos. No entanto, se seu módulo registrou rotinas de tratamento de 
evento usando espaços de nomes, você pode usar essa versão de um só argumento de unbind() para anu-
lar o registro apenas das rotinas de tratamento em seu espaço de nomes (ou espaços de nomes):
// Desvincula todas as rotinas de tratamento de mouseover e mouseout no espaço de nomes
// "myMod"
$('a').unbind("mouseover.myMod mouseout.myMod");
// Desvincula
